7,55.400001525878906,1,'cgonzaro',136),(40,'\0','2019-02-15 09:36:04',NULL,NULL,8,0,1,'fvellari',NULL),(41,'','2019-03-11 11:06:25','En cuanto al equipo, están los roles completamente definidos y las responsabilidades repartidas.\n\nAunque la dedicación del PO es de un 20 %, parece no afectar ala consecución de los objetivos perseguidos. Si bien, uno de los puntos que me preocupa, es la experiencia técnica del PO, ya que podría estar enfocando los PBIs de una manera no funcional, e incluso asesorando al equipo en puntos técnicos.\n\nAunque la dedicación de la SM no es al 100 %, al igual que en el caso del PO, le permite alcanzar la consecución de sus objetivos. Si bien habría que revisar qué labores realiza como SM y enfocar su rol hacia un punto más práctico.\n\nEn cuanto al equipo de desarrollo, habría que formarlos en la metodología Scrum ya que no todos ellos están alineados con el conocimiento necesario a nivel de Scrum Developer. En cuanto obtengan este conocimiento, quizás le podrían sacar mucho más partido a la metodología.\n\nEn relación a los eventos:\n- Sprint de 3 semanas, estables.\n- Daily Scrum, en pocas ocasiones se debaten puntos técnicos, por lo que habría que intentar mediar para evitar que se emplee tiempo y esfuerzo en ellos.\n- Refienement, no se celebra. La clarificación de los items se hace directamente en la planning.\n- Sprint Planning, en ocasiones no puede acudir el PO y ese rol lo asume la SM. Los SP que se emplean en la planificación se sumen que son horas: 1 SP = 1 h de esfuerzo.\n- Sprint Review, no participa al completo el equipo de desarrollo, no permitiéndoles poder enorgullecerse de su trabajo. Además aparte de esta review, se hace una minidemo con los stakeholders en la que se hace seguimiento del proyecto.\n- Sprint Retrospective, no se usan técnicas concretas, simplemente se debate abiertamente y se llegan a soluciones, a las que no se les hace un seguimiento por parte del equipo.\n\nEn cuanto a Herramientas habría que ahondar mucho más en el PB + SB + DoD, porque no me queda muy claro del todo, cómo lo tienen montado.\n\nEn relación al Mindset se le requiere mayor participación a la SM para el resto de la organización ya que no sabemos si los managers o líderes del proyecto están alineados con Scrum. Se tiene que poner el foco en las interrupciones frecuentes al equipo, así como en regular los time-boxes de las reuniones para que no se disparen.\n\nEn la Aplicación Práctica, habría que darle una vuelta a la estimación en SP y horas, así como a los chart de seguimientos que maneja el equipo para que les sean útiles y puedan disparar discusiones.\n\nEn cuanto a misión, visión y valores, el equipo debería definir junto con los stakeholders el por qué de este encargo.',NULL,16,43.29999923706055,1,'marcossa',137),(42,'','2019-03-11 12:08:14','Se tiene una planificación completamente Waterfall.\nPara lo que le queda al equipo mejor acabar esta etapa tal y como están y en el comienzo de la nueva etapa empezar a realizar un acompañamiento metodológico para sentar las bases correctas de colaboración.',NULL,15,18.700000762939453,1,'marcossa',141),(43,'\0','2019-03-11 13:36:07',NULL,NULL,9,0,1,'marcossa',NULL),(44,'','2019-03-12 12:08:58',NULL,NULL,13,20.299999237060547,1,'marcossa',141),(45,'','2019-03-13 16:03:24','Los PO (Lara y Alfonso) no hacen la función real de PO, serían más el Rol de Stakeholder, ya que es uno de los que tiene el Rol de SM (Diego) quien escribe las US. Además existe otro rol de SM (Carlos G) que lo que hace es resolver impedimentos técnicos por su conocimiento, y otro rol de SM (Carlos P) que se encarga de resolver impedimentos de infraestructuras de la propia compañía. En este caso faltaría un esquema de Roles y Responsabilidades de cada uno de ellos.\n\nEn cuanto a los eventos, les falta el mantener el timebox del sprint en el tiempo, asumiendo que en vacaciones van a tener menor capacidad. Además debido al problema anterior añadido, las reuniones aunque se celebran no participan los punteros adecuados. Habría que re-estructurar los hábitos de las reuniones.\n\nEn cuanto a herramientas, cuentan con un Jira de cliente, que habría que ver cómo se representa el PB y cómo son cada uno de esos items. No cuentan con SB y tampoco con DoD. No se sabe cómo garantizan la calidad del incremento generado.\n\nLa cultura organizacional de SM no existe, porque está enfocado al proyecto. Suelen ser disciplinados y practican la mejora continua.\n\nEn cuanto a métricas, no cuentan con Sprint Burndown, estiman en SP y miden por capacidad, por lo que me da la sensación de que asumen SP = H.',NULL,17,28.799999237060547,1,'marcossa',141),(46,'','2019-03-15 10:05:32',NULL,NULL,18,38.5,1,'marcossa',141),(47,'\0','2019-03-15 12:15:26',NULL,NULL,22,0,1,'jbeltrma',44),(48,'','2019-03-28 09:52:50',NULL,NULL,23,58.29999923706055,1,'agiampas',141),(50,'\0','2019-04-04 15:52:07',NULL,NULL,2,0,1,'marcossa',NULL),(51,'\0','2019-04-23 23:21:45',NULL,NULL,10,0,1,'acornago',1),(52,'','2019-04-29 09:21:30',NULL,NULL,23,56.79999923706055,1,'agiampas',141),(53,'\0','2019-04-29 09:25:39',NULL,NULL,23,0,1,'agiampas',NULL);
